package swax.web.form;import org.springframework.web.multipart.MultipartFile;public class PojoModelImportWantlistForm {		private String wantlistURL;		private MultipartFile wantlistFilePath;	private String wantlistErrorMsg = "";		public String getWantlistURL() {		return wantlistURL;	}	public void setWantlistURL(String wantlistURL) {		this.wantlistURL = wantlistURL;	}	public MultipartFile getWantlistFilePath() {		return wantlistFilePath;	}	public void setWantlistFilePath(MultipartFile wantlistFilePath) {		this.wantlistFilePath = wantlistFilePath;	}	public String getWantlistErrorMsg() {		return wantlistErrorMsg;	}	public void setWantlistErrorMsg(String wantlistErrorMsg) {		this.wantlistErrorMsg = wantlistErrorMsg;	}}